def initGames():
    db = Database()
    keys = ["id", "showName", "lottery", "frequency", "type", "times", "stopDelay", "downCode", "fenDownCode", "liDownCode", "floatBonus", "maxBonus", "sort", "status", "description"]
    for line in config['gameLotteryInfoList']:
        sql = "insert into game_config ("+ ','.join(keys) +") values ("+ ','.join(['%s' for i in keys]) +")"
        line['lottery'] = line['shortName']
        del line['shortName']
        db.execute(sql, tuple([line[k] for k in keys]))
        

def initMethods():
    db = Database()
    keys = ["id", "type", "groupName", "name", "methodName", "minRecord", "maxRecord", "totalRecord", "sort", "status", "bonus", "oooNums", "oooBonus"]
    for line in config['gameLotteryMethodList']:
        sql = "insert into game_method ("+ ','.join(keys) +") values ("+ ','.join(['%s' for i in keys]) +")"
        line['groupName'] = line['group']
